import delIcon from './assets/delete.png';

function Note() {
    return (
        <div className='note-box'>
            <span> Note </span>
            <span>
                <p> Date 

                </p>
                <img src={delIcon} /> 
            </span>           
        </div>
    );
}

export default Note;
